import React, { useEffect, useRef } from 'react';

const projectsData = [
  {
    id: 1,
    label: 'PROJECT 1',
    title: 'Modelling Mobile App Design',
    description:
      "A fashion-forward design system with bold imagery and expressive typography.",
    image:
      'https://images.unsplash.com/photo-1556157382-97eda2d62296?auto=format&fit=crop&w=1200&q=80',
    frame: '#0015ff, #00c8ff, #ffffff',
    cardBg: 'linear-gradient(135deg,#ffe6f0,#ff9ecf)'
  },
  {
    id: 2,
    label: 'PROJECT 2',
    title: 'E Commerce Mobile App Design',
    description:
      "A clean commerce interface with product-focused screens and clear CTAs for conversion.",
    image:
      'https://images.unsplash.com/photo-1545239351-1141bd82e8a6?auto=format&fit=crop&w=1200&q=80',
    frame: '#0015ff, #00c8ff, #ffffff',
    cardBg: 'linear-gradient(135deg,#e6f4ff,#9ed8ff)'
  },
  {
    id: 3,
    label: 'PROJECT 3',
    title: 'Fitness Mobile App Design',
    description:
      "A motivating fitness dashboard with progress cards, quick actions and friendly colours.",
    image:
      'https://images.unsplash.com/photo-1511707171634-5f897ff02aa9?auto=format&fit=crop&w=1200&q=80',
    frame: '#0015ff, #00c8ff, #ffffff',
    cardBg: 'linear-gradient(135deg,#dfe6ff,#b0c8ff)'
  }
];

export default function Projects() {
  const refs = useRef([]);

  useEffect(() => {
    const observers = refs.current.map((el) => {
      if (!el) return null;
      const obs = new IntersectionObserver(
        (entries) => {
          entries.forEach((entry) => {
            if (entry.isIntersecting) {
              entry.target.classList.add('in-view');
              obs.unobserve(entry.target);
            }
          });
        },
        { threshold: 0.12 }
      );
      obs.observe(el);
      return obs;
    });

    return () => observers.forEach((o) => o && o.disconnect());
  }, []);

  return (
    <section id="projects" className="py-20 bg-[#030417]">
      <div className="container mx-auto px-6">
        <div className="max-w-4xl mx-auto text-center mb-12">
          <h2 className="text-sm uppercase tracking-widest text-[var(--accent)]">My Work</h2>
          <h3 className="mt-3 text-3xl sm:text-4xl font-display font-bold text-white">Latest Projects</h3>
          <p className="mt-4 text-gray-400">A selection of recent projects showcasing design and development skills.</p>
        </div>

        <div className="space-y-24">
          {projectsData.map((p, idx) => (
            <article
              key={p.id}
              ref={(el) => (refs.current[idx] = el)}
              className={`projects-row flex flex-col lg:flex-row items-center gap-8 ${idx % 2 === 1 ? 'lg:flex-row-reverse' : ''}`}
            >
              <div className="flex-1">
                <p className="text-sm tracking-widest text-[var(--accent)] mb-3">{p.label}</p>
                <h4 className="text-2xl md:text-3xl font-semibold text-white mb-3">{p.title}</h4>
                <p className="text-gray-400 mb-6">{p.description}</p>
                <a href="#" className="inline-flex items-center gap-2 text-[var(--accent)] hover:underline">
                  <span className="text-sm">Read more</span>
                  <svg className="w-4 h-4" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                    <path d="M5 12h14"></path>
                    <path d="M12 5l7 7-7 7"></path>
                  </svg>
                </a>
              </div>

              <div className="flex-1 flex justify-center lg:justify-end">
                <div className="relative project-visual w-[300px] h-[200px] sm:w-[380px] sm:h-[260px] md:w-[460px] md:h-[300px]">
                  {/* outer decorative cyan thick frame (back) */}
                  <div
                    className="absolute -left-12 -top-12 w-full h-full rounded-[26px] project-frame-outer"
                    style={{
                      borderStyle: 'solid',
                      borderWidth: '14px',
                      borderImageSource: 'linear-gradient(90deg, var(--primary), var(--accent))',
                      borderImageSlice: 1,
                    }}
                  />

                  {/* inner thin frame (middle) */}
                  <div
                    className="absolute -left-9 -top-9 w-full h-full rounded-[20px] project-frame-inner"
                    style={{
                      borderStyle: 'solid',
                      borderWidth: '16px',
                      borderImageSource: 'linear-gradient(90deg, var(--primary), var(--accent))',
                      borderImageSlice: 1,
                    }}
                  />

                  {/* colored card mimic (beneath image) */}
                  <div
                    className="absolute -left-3 -top-3 w-full h-full rounded-xl project-inner-card"
                    style={{ background: p.cardBg }}
                  />

                  {/* main image card (top) */}
                  <div className="relative w-full h-full rounded-xl overflow-hidden project-image-card z-20">
                    <img src={p.image} alt={p.title} className="w-full h-full object-cover" />
                    <div className="absolute inset-0 bg-black/20 mix-blend-overlay" />
                  </div>
                </div>
              </div>
            </article>
          ))}
        </div>
      </div>
    </section>
  );
}
